import React, { useEffect, useState } from 'react'
import { Week } from '../../../../../hooks/useMonth'

interface WeekViewProps {
  week: Array<Week>
}

const Day = (props: Week) => {
  const { date, isCurrentMonth } = props
  return (
    <>
      {date}
      {'  '}
      {isCurrentMonth}
    </>
  )
}

export const WeekView = (props: WeekViewProps) => {
  const { week } = props

  console.log(week)

  return (
    <div>
      {week &&
        week.map(day => {
          return (
            <>
              {day.date}
              {'  '}
              {day.isCurrentMonth}
            </>
          )
        })}
    </div>
  )
}
